import React from 'react';
import { Car } from '../types';

interface CarListProps {
    cars: Car[];
}

const CarList: React.FC<CarListProps> = ({ cars }) => {
    return (
        <div className="car-list">
            <h4>Lista de Carros</h4>
            <div className="row">
                {cars.map((car) => (
                    <div key={car.id} className="col-md-4 mb-4">
                        <div className="card">
                            <div className="card-body">
                                <h5 className="card-title">{car.marca.nome} {car.modelo.nome}</h5>
                                <p className="card-text">Ano: {car.ano}</p>
                                <p className="card-text">Pre√ßo: R$ {car.preco.toFixed(2)}</p>
                                <p className="card-text">Quilometragem: {car.quilometragem} km</p>
                            </div>
                        </div>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default CarList;
